"<p>This blog is powered by b2evolution.</p>\n\n<p>You are currently looking at an info page about %s.</p>\n\n<p>Info pages are very much like regular posts, except that they do not appear in the regular flow of posts. They appear as info pages in the sidebar instead.</p>\n\n<p>If needed, an evoskin can format info pages differently from regular posts.</p>" => "<p>Ĉi tiu blogo estas kreita pere de b2evolution</p>.\n\n<p>Vi nune rigardas informan paĝon pri %s.</p>\n\n<p>Informaj paĝoj estas tre similaj al ordinaraj afiŝoj escepte de tio, ke ili ne aperas en la regula fluo de afiŝoj. Ili anstataŭe aperas kiel informaj paĝoj en la flankaĵo.</p>\n\n<p>Se bezonita, etoso povas aranĝi informajn paĝoj malsame de ordinaraj paĝoj.</p>.",
'About Blog B' => 'Pri Blogo B',
'Blog B' => 'Blogo B',
'About Blog A' => 'Pri Blogo A',
'Blog A' => 'Blogo A',
"<p>This blog platform is powered by b2evolution.</p>\n\n<p>You are currently looking at an info page about this site.</p>\n\n<p>Info pages are very much like regular posts, except that they do not appear in the regular flow of posts. They appear as info pages in the sidebar instead.</p>\n\n<p>If needed, an evoskin can format info pages differently from regular posts.</p>" => "<p>Ĉi tiu blogo estas kreita pere de b2evolution</p>.\n\n<p>Vi nune rigardas informan paĝon pri la TTT-ejo.</p>\n\n<p>Informaj paĝoj estas tre similaj je ordinaraj afiŝoj escepte de tio, ke ili ne aperas en la regula fluo de afiŝoj. Ili anstataŭe aperas kiel informaj paĝoj en la flankaĵo.</p>\n\n<p>Se bezonita, etoso povas aranĝi informajn paĝoj alimaniere de ordinaraj paĝoj.</p>.",
'About this site' => 'Pri la TTT-ejo',
'Main Intro post' => 'Ĉefa enkonduka afiŝo',
'This is the main intro post. It appears on the homepage only.' => 'Jen la ĉefa enkonduka afiŝo. Ĝi nur aperas en la ĉefpago',
'This uses post type "Intro-Cat" and is attached to the desired Category(ies).' => 'Ĉi tio uzas afiŝtipon "Intro-Cat" kaj estas almetita al la dezirata kategorio(j).',
'b2evolution tips category &ndash; Sub Intro post' => 'b2evolution klinas kategorion &ndash; sub enkonduka afiŝo',
'This uses post type "Intro-Tag" and is tagged with the desired Tag(s).' => 'Ĉi tio uzas afiŝtipon "Intro-Tag" kaj estas etikedata per la deziritaj tago(j).',
'Widgets tag &ndash; Sub Intro post' => 'Umaĵa etkido &ndash; sub enkonduka afiŝo',
"<p>This is a demo of a featured post.</p>\n\n<p>It will be featured whenever we have no specific \"Intro\" post to display for the current request. To see it in action, try displaying the \"Announcements\" category.</p>\n\n<p>Also note that when the post is featured, it does not appear in the regular post flow.</p>" => '<p>Jen demonstro de plej reĝa afiŝo.</p>',
"<p>b2evolution comes with an <code>.htaccess</code> file destined to optimize the way b2evolution is handled by your webseerver (if you are using Apache). In some circumstances, that file may not be automatically activated at setup. Please se the man page about <a %s>Tricky Stuff</a> for more information.</p>\n\n<p>For further optimization, please review the manual page about <a %s>Performance optimization</a>. Depending on your current configuration and on what your <a %s>web hosting</a> company allows you to do, you may increase the speed of b2evolution by up to a factor of 10!</p>" => "<p>b2evolution inkluzivas dosieron <code>.htaccess</code>, destinite por maksimumigi la traktadon de b2evolution de Apache. Laŭ iaj cirkonstancoj tiu dosiero eble ne aŭtomate estos aŭtomate aktivigita je plenumo. Bonvolu vidi la manlibran paĝon pri <a %s>Konfuzaj Aferoj</a> por pli da informoj.</p>\n\n<p>Por pluaj maksimumigoj bonvolu kontroli la manlibran paĝon pri <a %s>Rendimenta maksimumigo</a>. Depende de via aktuala agordo kaj de tio, kion via <a %s>TTT-gastiga</a> firmao permesas, vi eble povos kreskigi la rapidon de b2evolution 10-oble.</p>",
'Apache optimization...' => 'Plej bona funkciado de Apaĉo…',
"<p>By default, blogs are displayed using an evoskin. (More on skins in another post.)</p>\n\n<p>This means, blogs are accessed through '<code>index.php</code>', which loads default parameters from the database and then passes on the display job to a skin.</p>\n\n<p>Alternatively, if you don't want to use the default DB parameters and want to, say, force a skin, a category or a specific linkblog, you can create a stub file like the provided '<code>a_stub.php</code>' and call your blog through this stub instead of index.php .</p>\n\n<p>Finally, if you need to do some very specific customizations to your blog, you may use plain templates instead of skins. In this case, call your blog through a full template, like the provided '<code>a_noskin.php</code>'.</p>\n\n<p>If you want to integrate a b2evolution blog into a complex website, you'll probably want to do it by copy/pasting code from <code>a_noskin.php</code> into a page of your website.</p>\n\n<p>You will find more information in the stub/template files themselves. Open them in a text editor and read the comments in there.</p>\n\n<p>Either way, make sure you go to the blogs admin and set the correct access method/URL for your blog. Otherwise, the permalinks will not function properly.</p>" => '<p>Apriore blogoj montriĝos per etosoj. Se vi ne volas uzi etosojn, uzi la dosieron a_noskin.php.</p>',
'Skins, Stubs, Templates &amp; website integration...' => 'Etosoj, ĝermoj, ŝablonoj kaj TTT-eja integriĝo…',
"<p>b2evolution blogs are installed with a default selection of Widgets. For example, the sidebar of this blog includes widgets like a calendar, a search field, a list of categories, a list of XML feeds, etc.</p>\n\n<p>You can add, remove and reorder widgets from the Blog Settings tab in the admin interface.</p>\n\n<p>Note: in order to be displayed, widgets are placed in containers. Each container appears in a specific place in an evoskin. If you change your blog skin, the new skin may not use the same containers as the previous one. Make sure you place your widgets in containers that exist in the specific skin you are using.</p>" => "<p>Blogoj de b2evolution instaliĝas kun apriora elekto de umaĵoj. Ekzemple la flankaĵo de ĉi tiu blogo inkluzivas umaĵojn kiel kalendaron, serĉilon, liston de kategorioj, liston de XML-fluoj, ktp.</p>\n\n<p>Vi povas aldoni, forigi kaj reordigi umaĵojn de la langeton Bloga agordo en la stira fasado.</p>\n\n<p>Noto: por montriĝado umaĵaj metiĝis en ujojn. Ĉiu ujo aperas en specifa loko en etoso. Se vi ŝanĝas vian blogan etoson, la nova etoso eble ne uzos la samajn ujojn, kiuj ekzistas en la specifa etoso, kiun vi uzas.</p>",
'About widgets...' => 'Pri umaĵoj…',
"<p>By default, b2evolution blogs are displayed using an evoskin.</p>\n\n<p>You can change the skin used by any blog by editing the blog settings in the admin interface.</p>\n\n<p>You can download additional skins from the <a href=\"http://skins.b2evolution.net/\" target=\"_blank\">skin site</a>. To install them, unzip them in the /blogs/skins directory, then go to General Settings &gt; Skins in the admin interface and click on \"Install new\".</p>\n\n<p>You can also create your own skins by duplicating, renaming and customizing any existing skin folder from the /blogs/skins directory.</p>\n\n<p>To start customizing a skin, open its \"<code>index.main.php</code>\" file in an editor and read the comments in there. Note: you can also edit skins in the \"Files\" tab of the admin interface.</p>\n\n<p>And, of course, read the <a href=\"%s\" target=\"_blank\">manual on skins</a>!</p>" => "<p>Apriore b2evolution-blogoj montriĝos per la etoso evoskin.</p>\n\n<p>Vi povas ŝanĝi la etoson uzatan de iu ajn blogo per redaktado de la bloga agordo en la stira interfaco.</p>\n\n<p>Vi povas elŝuti aldonajn etosojn el <a href=\"http://skins.b2evolution.net/\">la etosa ejo</a>. Por instali ilin elpaku en la dosierujojn <cite>/blogs/skins/</cite>, navigu al Tutprograma agordo &gt; Etosoj en la stira interfaco kaj klaki sur \"Instali novan\".</p>\n\n<p>Vi ankaŭ povas krei proprajn etosojn per duobligo, alinomado aŭ alproprigo de iu jama etosa dosierujo el la dosierujo /blogs/skins.</p>\n\n<p>Por ekagordi etoson malfermu la dosieron '<cite>index.main.php</cite>' en tekstoredaktilo kaj legi la komentojn en tio. Noto: Vi povas ankaŭ redakti etosojn sub la langeto \"Dosieroj\" en la stira interfaco.</p>\n\n<p>Kaj kompreneble legu la <a href=\"%s\">manlibron pri etosoj</a>!</p>",
'About skins...' => 'Pri etosoj…',
"<p>This post has an image attached to it. The image is automatically resized to fit the current blog skin. You can zoom in by clicking on the thumbnail.</p>\n\n<p>Check out the photoblog (accessible through the links at the top) to see a completely different skin focused more on the photos than on the blog text.</p>" => "<p>Ĉi tiu afiŝo havas bildon almetita al ĝi. La bildo aŭtomate aligrandiĝas por adaptiĝi al la aktuala bloga etoso. Vi povas zomi per alklaki la minaturon.</p>\n\n<p>Vidi la fotan blogon (atingebla per la ligiloj supre de la paĝo) por vidi alian etoson pli taŭgan por fotoj ol por bloga teksto.</p>",
'Image post' => 'Bilda afiŝo',
"<p>This is page 1 of a multipage post.</p>\n\n<p>You can see the other pages by clicking on the links below the text.</p>" => "<p>Jen paĝo 1 de plurpaĝa afiŝo.</p>\n\n<p>Vi povas vidi la aliajn paĝojn per alklakado de la ligiloj sube de la teksto.</p>",
'This is a multipage post' => 'Jen plurpaĝa afiŝo',
