'<p>This is an extended post. This means you only see this small teaser by default and you must click on the link below to see more.</p>' => '<p>Jen etendita afiŝo. Alivorte vi vidos nur ĉi tiun malgrandan komencan eltiraĵon kaj vi devos klaki sur la ligilo sube por pli vidi.</p>',
'Extended post' => 'Etendita afiŝo',
'Welcome to your b2evolution-powered website!' => 'Bonvenon al b2evolution-kreita TTT-ejo!',
"<p>To get you started, the installer has automatically created several sample collections and populated them with some sample contents. Of course, this starter structure is all yours to edit. Until you do that, though, here's what you will find on this site:</p>\n\n<ul>\n<li><strong>Blog A</strong>: You are currently looking at it. It contains a few sample posts, using simple features of b2evolution.</li>\n<li><strong>Blog B</strong>: You can access it from the link at the top of the page. It contains information about more advanced features. Note that it is deliberately using a different skin from Blog A to give you an idea of what's possible.</li>\n<li><strong>Photos</strong>: This collection is an example of how you can use b2evolution to showcase photos, with photos grouped into photo albums.</li>\n<li><strong>Forums</strong>: This collection is a discussion forum (a.k.a. bulletin board) allowing your users to discuss among themselves.</li>\n<li><strong>Manual</strong>: This showcases how b2evolution can be used to publish structured content such as an online manual or book.</li>\n\n</ul>\n\n<p>You can add new collections of any type (blog, photos, forums, etc.), delete unwanted one and customize existing collections (title, sidebar, blog skin, widgets, etc.) from the admin interface.</p>" => "<p>Kiel ekzemplo la instalilo aŭtomate kreis kelkajn specimenajn kolektojn kun specimena enhavo. Kompreneble tiu specimena strukturo estas redaktenda. Antaŭ ol vi faros tion, jen tio, kio troveblas ĉe la TTT-ejo:</p>\n\n<ul>\n\t<li><strong>Blogo A</strong>: Vi nune rigardas ĝin. Ĝi enhavas kelkajn specimenajn afiŝojn, uzante simplajn trajtojn de b2evolution.</li>\n\t<li><strong>Blogo B</strong>: Vi povas atingi ĝin per ligilo ĉe la supro de la paĝo. Ĝi enhavas informojn pri pli altnivelaj trajtoj. Notu, ke ĝi laŭcele uzas alian etoson de Blogo A por montri al vi tion, kio eblas.</li>\n\t><li><strong>Fotoj</strong>: Tiu kolekto estas ekzemplo de kiel vi povas uzi b2evolution-on por elmontri fotojn, dividitajn en albumojn.</li>\n\t<li><strong>Forumoj</strong>: Tiu kolekto estas diskuta forumo, permesante al vi lasi, ke uzantoj priparolu inter sin.</li>\n\t<li><strong>Manlibro</strong>: Tiu elmontras, kiel b2evolution uzeblas por publikigi enhavan strukturitan aŭ libran.</li>\n\n</ul>\n\n<p>vi povas aldoni novajn kolektojn ajnaspecajn (blogon, fotojn, forumojn ktp), forigi nevolitajn kaj personigi jamajn kolekto-partojn (titolon, flankaĵon, etoson, umaĵojn ktp) en la stirilo.</p>",
