"<p>This is an extended topic. This means you only see this small teaser by default and you must click on the link below to see more.</p>\n\n[teaserbreak]\n\n<p>This is the extended text. You only see it when you have clicked the \"more\" link.</p>" => "<p>Jen etendita temo. Alivorte vi vidos nur etan eltiraĵon aŭtomate kaj vi devos alklaki la suban ligilon por vidi pliajn.</p>\n\n[teaserbreak]\n\n<p>Jen etendita teksto. Vi vidos ĝin nur post kiam vi alklakis la ligilon \"plu\"</p>",
'Extended topic' => 'Etendita temo',
"<p>Four blogs have been created with sample contents:</p>\n\n<ul>\n<li><strong>Blog A</strong>: You are currently looking at it. It contains a few sample posts, using simple features of b2evolution.</li>\n<li><strong>Blog B</strong>: You can access it from a link at the top of the page. It contains information about more advanced features.</li>\n<li><strong>Linkblog</strong>: By default, the linkblog is included as a \"Blogroll\" in the sidebar of both Blog A &amp; Blog B.</li>\n<li><strong>Photos</strong>: This blog is an example of how you can use b2evolution to showcase photos, with one photo per page as well as a thumbnail index.</li>\n</ul>\n\n<p>You can add new blogs, delete unwanted blogs and customize existing blogs (title, sidebar, blog skin, widgets, etc.) from the Blog Settings tab in the admin interface.</p>" => "<p>Kvar blogoj kreiĝis kun specimena enhavo:</p>\n\n<ul>\n\t<li><strong>Blogo A</strong>: Vi nune rigardas ĝin. Ĝi enhavas kelkajn specimenajn afiŝojn, uzante simlajn trajtojn de b2evolution.</li>\n\t<li><strong>Blogo B</strong>: Vi povas atingi ĝin per ligilo ĉe la supro de la paĝo. Ĝi enhavas informojn pri pli altnivelaj trajtoj.</li>\n\t<li><strong>Ligila Blogo</strong>: Apriore la ligila blogo uzeblas kiel \"Listo de legindaj blogoj\" en la flankaĵoj de kaj Blogo A kaj Blogo B.</li>\n\t><li><strong>Fota blogo</strong>: La blogo estas ekzemplo de kiel vi povas uzi b2evolution-on por elmontri fotojn, kun unu fotoj en ĉiu paĝo kaj ankaŭ indekso de miniaturoj.</li>\n</ul>\n<p>vi povas aldoni novajn blogojn, forigi nevolitajn blogojn kaj personigi jamajn blogojn (titolon, flankaĵon, etoson, umaĵojn ktp) en la bloga agordo folio de la stirilo.</p>",
'Welcome to b2evolution!' => 'Bonvenon al b2evolution!',
