'No default time zone is set. Please open PHP.ini and set the value of \'date.timezone\' (Example: date.timezone = Europe/Paris) or open /conf/_advanced.php and set the value of %s (Example: %s)' => 'Neniu apriora horzono elektita. Bonvolu specifi la valoron de \'date.timezine\' (ekz-e: date.timezone = Europe/Paris) en php.ini aŭ specifi la valoron de %s (ekz-e: %s) en /conf/_advanced.php',
