'It seems that the database config settings you entered don\'t work. Please check them carefully and try again...' => 'Ŝajnas, ke la datumbaza agordaĵoj, kiujn vi enmetis ne funkciis. Bonvolu zorgi kontroli ilin kaj denove provi…',
