'There are two ways to deal with this:' => 'Estas du manieroj por trakti ĉi tion:',
'You can allow the installer to create the config file by changing permissions for the /conf directory:' => 'Vi povas permesi, ke la instalilo kreu la agordan dosieron per ŝanĝado de antigopermesoj por la dosierujo /conf:',
'Make sure there is no existing and potentially locked configuration file named <code>%s</code>. If so, please delete it.' => 'Certigi, ke estas nenia jama kaj eble ŝlosita agorda dosiero <code>%s</code>. Se tia, bonvolu forigi ĝin',
'<code>chmod 777 %s</code>. If needed, see the <a %s>online manual about permissions</a>.' => '<code>chmod 777 %s</code>. Se necese, vidi la <a %s>retan manlibron pri atingopermesoj</a>.',
'Come back to this page and refresh/reload.' => 'Reveni al ĉi tiu paĝo kaj reŝargi.',
'Alternatively, you can update the config file manually:' => 'Alternative vi povas permane aktualigi la agordan dosieron:',
'Create a new text file with a text editor.' => 'Krei novan platan dosieron per tekstoredaktilo…',
'Copy the contents from the box below.' => 'Kopii el la suba teksta kampo la enhavon.',
'Paste them into your local text editor. <strong>ATTENTION: make sure there is ABSOLUTELY NO WHITESPACE after the final <code>?&gt;</code> in the file.</strong> Any space, tab, newline or blank line at the end of the conf file may prevent cookies from being set when you try to log in later.' => 'Alglui al via tekstoredaktilo ilin. <strong>AVERTO: certigi, ke estas TUTE NENIA BLANKA SPACO post la fina <code>?&gt;</code> en la dosiero. </strong> Iu spaceto, tabo, novlinio, aŭ vaka linio je la fino de la agorda dosiero eble preventas konservadon de kuketoj kiam vi pli malfrue ensaluti.',
'Save the file locally under the name <code>_basic_config.php</code>' => 'Loke konservi la dosieron sub la nomo <code>_basic_config.php</code>',
'Upload the file to your server, into the <code>/_conf</code> folder.' => 'Alŝuti la dosieron al via servilo en la dosierujon <code>/_conf</code>.',
'<a %s>Call the installer from scratch</a>.' => '<a %s>Malplene voki la instalilon</a>.',
'This is how your _basic_config.php should look like:' => 'Jen kiel aperos la dosiero _basic_config.php:',
'Resetting the base configuration is currently disabled for security reasons.' => 'Restarigi la bazan agordon aktuale estas malaktivigita pro sekurecaj kialoj.',
'To enable it, please go to the %s file and change: %s to %s' => 'Por aktivigi ĝin bonvolu iri al la dosiero %s kaj ŝanĝi de %s al %s',
'Then reload this page and a reset option will appear.' => 'Tiam reŝargi ĉi tiun paĝon kaj elekto por restarigado aperos.',
'The basic configuration file (<code>/conf/_basic_config.php</code>) has not been created yet. You can do automatically generate it by filling out the form below.' => 'La baza agorda dosiero dosiero (<code>/conf/_basic_config.php</code>) ankoraŭ ne kreiĝis. Vi povas aŭtomate generi ĝin per plenigado de la suba formulario.',
'This is the minimum info we need to set up b2evolution on this server:' => 'Jen la minimumaj informaj, kiuj vi bezonas agordi la blogon en ĉi tiu servilo:',
'Database you want to install into' => 'Datumbazo en kiu vi volas instali',
'b2evolution stores blog posts, comments, user permissions, etc. in a MySQL database. You must create this database prior to installing b2evolution and provide the access parameters to this database below. If you are not familiar with this, you can ask your hosting provider to create the database for you.' => 'b2evolution konservas blogerojn, komentojn, atingopermesojn ktp en MySQL-datumbazo. Vi devas krei tiun datumbazon antaŭ instalado de b2evolution kaj provizi la atingajn parametrojn al tiu datumbazo ĉi-sube. Se vi ne familiaras kn tio, vi povas peti, ke via gastiganto kreu la datumbazon por vi.',
'Typically looks like "localhost" or "sql-6" or "sql-8.yourhost.net"...' => 'Tipe similas "localhost" aŭ "sql-6" aŭ "sql-8.yourhost.net"…',
'MySQL Database' => 'MySQL-datumbazo',
'Name of the MySQL database you have created on the server' => 'MySQL-datumbazo, kiun vi kreis en la servilo',
'Used by b2evolution to access the MySQL database' => 'Uzita de b2evolution por atingi la MySQL-datumbazon',
'Additional settings' => 'Aldonaj agordaĵoj',
'This is where b2evo and your blogs reside by default. CHECK THIS CAREFULLY or not much will work. If you want to test b2evolution on your local machine, in order for login cookies to work, you MUST use http://<strong>localhost</strong>/path... Do NOT use your machine\'s name!' => 'Jen kie viaj blogoj loĝas aŭtomate. ZORGE kONTROLI ĈI TIO aŭ ne multo funkcios. Se vi volas testi la blogon en via loka komputilo por ensalutaj kuketoj funkcii, vi devas uzi la vojon http://<strong>localhost</strong>/vojo ne la nomo de via komputilo.',
'This is used to create your admin account. You will receive notifications for comments on your blog, etc.' => 'Ĉi tiu uziĝas por krei vian estran konton. Vi ricevos sciigojn por komentoj en via blogo ktp',
'Update config file' => 'Aktualigi agordan dosieron',
'How would you like your b2evolution installed?' => 'Kiel vi ŝatus instaliĝi b2evolution?',
'The installation can be done in different ways. Choose one:' => 'La instalado povas fariĝi laŭ diversaj manieroj. Elektu iun:',
'<strong>New Install</strong>: Install b2evolution database tables.' => '<strong>Nova instalado</strong>: Instali datumbazajn tabelojn de b2evolution.',
'Also install sample blogs &amp; sample contents. The sample posts explain several features of b2evolution. This is highly recommended for new users.' => 'Ankaŭ instali specimenajn blogojn kaj enhavon. La specimenaj afiŝoj klarigas plurajn trajtojn de b2evolution. Tio ege rekomendiĝas por novaj uzantoj.',
'This is a local / test / intranet installation.' => 'Jen loka/prova/lokreta instalado.',
'Also install all test features.' => 'Ankaŭ instali ĉiajn provajn trajtojn.',
'<strong>Upgrade from a previous version of b2evolution</strong>: Upgrade your b2evolution database tables in order to make them compatible with the current version. <strong>WARNING:</strong> If you have modified your database, this operation may fail. Make sure you have a backup.' => '<strong>Promocii disde antaŭa eldono de b2evolution</strong>: Promocii viajn datumbazajn tabelojn por konformigi ilin kun la aktuala eldono. <strong>AVERTO:</strong> Se vi modifis vian datumbazon ĉi tiu funkciigo eble malsukcesos. Certigi, ke vi havas sekurkopion.',
'Delete b2evolution tables &amp; cache files' => 'Forigi b2evolution-tabelojn k tenejaj dosieroj',
'If you have installed b2evolution tables before and wish to start anew, you must delete the b2evolution tables before you can start a new installation. <strong>WARNING: All your b2evolution tables and data will be lost!!!</strong> Any non-b2evolution tables will remain untouched though.' => 'Se vi insntalas la b2evolution-tabelojn antaŭe kaj volas freŝe komennci, vi devas forigi la b2evolution-tabelojn kaj datumoj perdiĝos. <strong>AVERTO: Ĉiuj viaj b2evolution-tabeloj kaj datumoj perdiĝos.</strong> Iaj fremdaj restos netuŝitaj.',
'<strong>Change your base configuration</strong> (see recap below): You only want to do this in rare occasions where you may have moved your b2evolution files or database to a different location...' => '<strong>Ŝanĝi vian bazan agordon</strong> (vidi resumon sube): Vi volas fari tion nur en maloftaj okazoj en kiu vi eble movis viajn dosierojn aŭ datumbazon al alia loko…',
'<strong>Upgrade your DB to UTF-8</strong>: all the b2evolution tables in your b2evolution MySQL database will be converted to UTF-8 instead of their current charset.' => '<strong>Gisdatigi vian datumbazo al UTF-8</strong>: Ĉiuj el la b2evolution-tabeloj en via b2evolution-a MySQL-datumbazo konvertiĝos al UTF-8 anstataŭ ilia nuna kodoprezento.',
'Need to start anew?' => 'Ĉu bezonas refoje komenci?',
'GO!' => 'IRI!',
"Are you sure you want to delete your existing %s tables?\\nDo you have a backup?" => "Ĉu vi certas, ke vi volas forigi viajn jamajn tabelojn %s?\\nĈu vi havas rezervon?",
'Back to install menu' => 'Reen al instalada menuo',
'In order to install b2evolution with the %s locale, your MySQL needs to support the %s connection charset.' => 'Por instali kun la lokaĵaro %s, via MySQL bezonas regi la konektan signaron %s.',
'Installing b2evolution...' => 'Instaliĝanta b2evolution-on…',
'Checking files...' => 'Kontrolanta dosierojn…',
'Upgrading b2evolution...' => 'Promocianta b2evolution-on…',
'WARNING: the max_execution_time is set to %s seconds in php.ini and cannot be increased automatically. This may lead to a PHP <a %s>timeout causing the upgrade to fail</a>. If so please post a screenshot to the <a %s>forums</a>.' => 'AVERTO: max_execution_tempo estas agordita al %s sekundoj en php.ini kaj ne povas aŭtomate pliiĝi. Tio eble kaŭzon <a %s>eksvalidiĝo kaŭzanta malsukcesan ĝisdatigon</a>. Tiel afiŝu ekrankopion en la <a %s>forumoj</a>.',
'Upgrading data in existing b2evolution database...' => 'Promocianta datumojn en jama datumbazo…',
'Upgrade completed successfully!' => 'Promocio sukcese finita.',
'Now you can <a %s>log in</a> with your usual %s username and password.' => 'Nun vi povas <a %s>ensaluti</a> per viaj kutima salutnomo %s kaj pasvorto.',
'Deleting b2evolution tables from the datatase...' => 'Foriganta la b2evolution-tabeloj el la datumbazo…',
'If you have installed b2evolution tables before and wish to start anew, you must delete the b2evolution tables before you can start a new installation. b2evolution can delete its own tables for you, but for obvious security reasons, this feature is disabled by default.' => 'Se vi instalis b2evolution-tabelojn antaŭe kaj volas komenci refoje, vi devas forigi la b2evolution-tabelojn antaŭ ol vi povas komenci novan instaladon. b2evolution povas forigi ĝiajn proprajn tabelojn por vi, sed pro evidentaj sekurecaj kialoj tio trajto estas apriore malaktivigita.',
